import React from "react";
import Header from "../../components/Header"
import Footer from "../../components/Footer"
import logo from "../../images/airScannerColor.png"
import s from "./AboutCompany.module.scss";
function AboutCompany(){
    return(
        <>
        <Header />
        <div className={s.wrapper}>
            <img src={logo} alt="airScanner" className={s.logo} />
            <p>When we started in 2023, we set out to do things differently. We wanted to show travellers all flight options in one place, creating a simple alternative to the confusing sites that make travel feel like hard work.

Fast forward to today and we’re a global leader in travel, with more than 100 million people across the world using our app and website every month. We pride ourselves on being transparent and unbiased, searching billions of prices for flights, hotels and car hire to help find the best deals available.

We’re on a mission to help travellers plan and book their trip with ease and confidence. Whether it’s using technology to make the complex simple or connecting travellers with trusted partners to provide honest and transparent solutions, we’re determined to help everyone find the best offer for them.</p>
        </div>
        <Footer/>
        </>
    )
}
export default AboutCompany;
